import http from "../http-common";
import authHeader from './auth-header';

class PlayerDataService {
  getAll() {
    return http.get("/players", { headers: authHeader() });
  }

  get(player_id) {
    return http.get(`/players/${player_id}`, { headers: authHeader() });
  }

  create(data) {
    return http.post("/players", data, { headers: authHeader() });
  }

  update(player_id, data) {
    return http.put(`/players/${player_id}`, data, { headers: authHeader() });
  }

  delete(player_id) {
    return http.delete(`/players/${player_id}`, { headers: authHeader() });
  }

  findPlayerByUser(user_id) {
    console.log("AAAAA");
    return http.get(`/players/user/${user_id}`, { headers: authHeader() });
  }
}

export default new PlayerDataService();
